import React from 'react'

const Home = () => {
  return (
    <div>
        <p>Headers</p>
        <p>Main slider</p>
        <p>New movies</p>
        <p>Trending movies</p>
        <p>Top-rated movies</p>
    </div>
  )
}

export default Home
